  [],\n\t\"num_tags\": 0,\n\t\"name\": \"oceanographic-profile-data-collected-from-ctd-and-sound-velocimeter-moving-vessel-profiler-casffbd8\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130783 includes physical
  and profile data collected aboard NOAA Ship FAIRWEATHER during project OPR-O193-FA-10
  in the Coastal Waters of SE Alaska and North Pacific Ocean from 2010-04-22 to 2010-05-23.
  These data include CONDUCTIVITY, HYDROSTATIC PRESSURE, SALINITY, SOUND VELOCITY,
  WATER DENSITY and WATER TEMPERATURE. The instruments used to collect these data
